import React from "react";

const Navbar=()=> {
    return(
        <nav>
            <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fplay-lh.googleusercontent.com%2F6UgEjh8Xuts4nwdWzTnWH8QtLuHqRMUB7dp24JYVE2xcYzq4HA8hFfcAbU-R-PC_9uA1&tbnid=i7MoRy5G8Xd9xM&vet=12ahUKEwjMptre6M7-AhV5nycCHa-yCHkQMygAegUIARDgAQ..i&imgrefurl=https%3A%2F%2Fplay.google.com%2Fstore%2Fapps%2Fdev%3Fid%3D5700313618786177705%26hl%3Den_US%26gl%3DUS&docid=x_hf6-7_nBDr_M&w=512&h=512&q=google&ved=2ahUKEwjMptre6M7-AhV5nycCHa-yCHkQMygAegUIARDgAQ" className="nav--logo" alt="airbnb"/>
        </nav>
    )
}
export default Navbar;
